import React from 'react'
import './App.css'
import {BrowserRouter as Router, Link, Route, Redirect, Switch} from 'react-router-dom'
import Login from'./Component/Login'
import SignUp from './Component/SignUp'
import Start from './project/Start'
import Protect from './Component/Protect'
import Begin from './Component/Begin'
import Footer from './Component/Footer'
import NotFound from './Component/NotFound'
import Logout from './Component/Logout'

export default class App extends React.PureComponent {
  render() {
    return (
      <Router>


        {
            localStorage.getItem("login") ? <Route path="/login"> <Redirect to="/"/></Route>: <Route exact path="/login" component={Login} />
        }
        {
            localStorage.getItem("login") ? <Route path="/signup"> <Redirect to="/"/></Route>: <Route exact path="/signup" component={SignUp} />
        }
          <Protect exact path="/" component={Begin}/>

          <Route exact path="/login"
              render={props => (
                  <Login {...props} />
              )}>
          </Route>
          <Route exact path="/signup" component={SignUp}/>

          <Route exact path="/logout" component={Logout}/>
          <Footer/>

          <Route exact path="*" component={NotFound}/>

      </Router>
    )
  }
}
